1; // 这里是自定义的颜色\n```\n\n4.  配置webpack less-loader\n\n\n```js\n// webpack.config.js\nconst path = require('path');\nconst fs  = require('fs');\n\nconst lessToJs = require('less-vars-to-js');\nconst themeVariables = lessToJs(fs.readFileSync(path.join(__dirname, './custom-theme-vars.less'), 'utf8'));\n\nmodule: {\n  rules: [\n    {\n      test: /\\.less$/,\n      use: [\n        {loader: \"style-loader\"},\n        {loader: \"css-loader\"},\n        {loader: \"less-loader\",\n          options: {\n            modifyVars: themeVariables\n          }\n        }\n      ]\n    }\n  ]\n}\n```\n  \n  \n5. fonts配置\n\n\n```js\n// webpack.config.js\nconst path = require('path');\nconst fs  = require('fs');\n\nconst lessToJs = require('less-vars-to-js');\nconst themeVariables = lessToJs(fs.readFileSync(path.join(__dirname, './custom-theme-vars.less'), 'utf8'));\n// lessToJs does not support @icon-url: \"some-string\", so we are manually adding it to the produced themeVariables js object here\nthemeVariables[\"@icon-url\"] = \"'//localhost:8080/fonts/iconfont'\";\n```\n"},function(e,t,n){"use strict";function _classCallCheck(e,t){if(!(e instanceof t))throw new TypeError("Cannot call a class as a function")}function _possibleConstructorReturn(e,t){if(!e)throw new ReferenceError("this hasn't been initialised - super() hasn't been called");return!t||"object"!=typeof t&&"function"!=typeof t?e:t}function _inherits(e,t){if("function"!=typeof t&&null!==t)throw new TypeError("Super expression must either be null or a function, not "+typeof t);e.prototype=Object.create(t&&t.prototype,{constructor:{value:e,enumerable:!1,writable:!0,configurable:!0}}),t&&(Object.setPrototypeOf?Object.setPrototypeOf(e,t):e.__proto__=t)}Object.defineProperty(t,"__esModule",{value:!0});var r=function(){function defineProperties(e,t){for(var n=0;n<t.length;n++){var r=t[n];r.enumerable=r.enumerable||!1,r.configurable=!0,"value"in r&&(r.writable=!0),Object.defineProperty(e,r.key,r)}}return function(e,t,n){return 